import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, Form, FormControl, Button, style} from 'react-bootstrap';

class Header extends Component {
	render(){
		var styles = {
			color: 'red'
		};

		return (
			<Navbar bg="light" variant="light" fix ='top'>
			    <Navbar.Brand href="#home">Stockify</Navbar.Brand>
			    <Nav className="mr-auto" style ={styles}>
			    	<FormControl type="text" placeholder="Search" className="mr-sm-2" />
			        <Button variant="outline-primary">Search</Button>
					<Nav.Link href="#home">Stock</Nav.Link>
				    <Nav.Link href="#features">Porfolio</Nav.Link>
				    <Nav.Link href="#pricing">Screener</Nav.Link>
				    <Nav.Link href="#pricing">Profile</Nav.Link>
			    </Nav>

			</Navbar>

		);
	}
}

export default Header;
